import React from "react";
import { ReactNavbar } from "react-responsive-animate-navbar";
// import logo from "../public/custome logo/Background.png"

import imageLogo from "./custome logo/Background.png"

const App = () => {
  const Home = () => <h1>home</h1>;
  const Articles = () => <h1>Articles</h1>;
  const Contact = () => <h1>Contact</h1>;
  const About = () => <h1>About</h1>;

  return (
    <div
      style={{ minHeight: "100vh", width: "100%" }}
    >
      <div>
            <img src={imageLogo}></img>
         </div>
      <ReactNavbar
        color="#191919"
        image
        menu={[
          { name: "HOME", to: "/", component: Home },
          { name: "ARTICLES", to: "/articles", component: Articles },
          { name: "ABOUT ME", to: "/about", component: About },
          { name: "CONTACT", to: "/contact" , component: Contact },
        ]}
        social={[
          {
            name: "Linkedin",
            url: "https://www.linkedin.com/kidussintayehu",
            icon: ["fab", "linkedin-in"],
          },
          {
            name: "Facebook",
            url: "https://www.facebook.com/siant.sintayehu/",
            icon: ["fab", "facebook-f"],
          },
          {
            name: "Instagram",
            url: "https://www.instagram.com/siantsintayehu/",
            icon: ["fab", "instagram"],
          },
          {
            name: "Github",
            url: "https://github.com/kidussintayehu",
            icon: ["fab", "github"],
          },
        ]}
        sticky
      />
    </div>
  );
};

export default App;
